This is a horribly flaky issue and usually only happens when using in Firefox.
Reproducing this consistently is next to impossible.

The issue has been listed multiple times for Mojarra already, namely [#547](https://github.com/eclipse-ee4j/mojarra/issues/547) and [#4280](https://github.com/eclipse-ee4j/mojarra/issues/4280)

This occurs due to Firefox's behaviour, when sending requests for resources, but canceling/dropping the connection midway through, because the cache was faster. There are 4 possible behaviours as described on the [Mozilla support-page](https://support.mozilla.org/en-US/questions/1267945). Of the 4 cases, the ClientAbortException only happens in case 4.

## Current Behaviour

The ClientAbortConnection is logged as IOException in the method call to `send404(context, resourceName, libraryName, ioe, true);`

It is logged on level `Warning` and prints the whole stacktrace into the log.

## This Change

The ClientAbortException is no longer logged, as there is no action that can be taken by the server.

## Further Details / Questions

- MyFaces handles it already like this. [Their implementation.](https://github.com/apache/myfaces/blob/ca18e438dd959de904bf5390906e9d6132ee4219/impl/src/main/java/org/apache/myfaces/application/ResourceHandlerImpl.java#L610)
- How should I handle the translation of the error messages?
- My current change does not abstract away sending the 404 status. I currently opted for the shortest possible fix. Is another approach suited better e.g. handling it inside `send404`?", 'reactions': {'url': 'https://api.github.com/repos/eclipse-ee4j/mojarra/issues/5072/reactions', 'total_count': 1, '+1': 1, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/eclipse-ee4j/mojarra/issues/5072/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/eclipse-ee4j/mojarra/issues/comments/1079949980', 'html_url': 'https://github.com/eclipse-ee4j/mojarra/pull/5072#issuecomment-1079949980', 'issue_url': 'https://api.github.com/repos/eclipse-ee4j/mojarra/issues/5072', 'id': 1079949980, 'node_id': 'IC_kwDOB7RWwc5AXrqc', 'user': {'login': 'mnriem', 'id': 15701806, 'node_id': 'MDQ6VXNlcjE1NzAxODA2', 'avatar_url': 'https://avatars.githubusercontent.com/u/15701806?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/mnriem', 'html_url': 'https://github.com/mnriem', 'followers_url': 'https://api.github.com/users/mnriem/followers', 'following_url': 'https://api.github.com/users/mnriem/following{/other_user}', 'gists_url': 'https://api.github.com/users/mnriem/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/mnriem/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/mnriem/subscriptions', 'organizations_url': 'https://api.github.com/users/mnriem/orgs', 'repos_url': 'https://api.github.com/users/mnriem/repos', 'events_url': 'https://api.github.com/users/mnriem/events{/privacy}', 'received_events_url': 'https://api.github.com/users/mnriem/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-27T15:07:23Z', 'updated_at': '2022-03-27T15:07:23Z', 'author_association': 'CONTRIBUTOR', 'body': 'How about employ what is illustrated in the ExceptionHandler JavaDoc 

